Описание  Регистрирует функцию-обработчик указанного события.  Возвращает дескриптор, который можно использовать для удаления обработчика
 в методе LiveTex.removeEventListener()  Возможна регистрация нескольких обработчиков на одно событие путем
 повторного вызова этого метода.  Параметры     Имя  Тип  Описание  Опциональность      eventType  string  Тип события  Опциональный    handler  !function({event: string, data: !Object})  Обработчик события  Опциональный     Пример  function onConversationStarted(data) {
  alert('Общение началось');
 }

 var descriptor = LiveTex.addEventListener(
  LiveTex.Event.CONVERSATION_STARTED, onConversationStarted);

