Описание  Возвращает флаг доступности отдела.
 Если в отделе нет операторов онлайн или
 все операторы имеют очередь обращений, достигшую установленного лимита,
 метод вернёт false.  Параметры     Имя  Тип  Описание  Опциональность      deptId  string  Идентификатор отдела.  Опциональный    complete  !function(boolean)  Обработчик, который получает     доступность операторов в отделе  Опциональный       Пример  LiveTex.isDepartmentAvailable('123123', function(isAvailable) {
    if (isAvailable) {
      alert('Операторы отдела 123123 доступны для нового обращения');
    }
 });

