Описание  Полностью реинициализирует сессию посетителя. Сбрасывает состояние.  ВНИМАНИЕ! Вызов этого метода при активном чате приведет к его немедленному
  закрытию. Вернуться к истории переписки посетитель уже не сможет.  Параметры     Имя  Тип  Описание  Опциональность      complete  !function()   Опциональный    cancel  !function()   Опциональный     Пример  function onSuccess() {
    console.log('LiveTex is reinitialized');
 }

 function onFail() {
    console.log('LiveTex is not reinitialized');
 }

 LiveTex.reinit(onSuccess, onFail);

Описание  Удаляет обработчик события,
 установленный с помощью метода LiveTex.addEventListener().  Параметры     Имя  Тип  Описание  Опциональность      eventType  string  Тип события  Опциональный    descriptor  string  Дескриптор события  Опциональный     Пример  function onConversationStarted(data) {
  alert('Общение началось');
 }

 // Регистрация обработчика
 var descriptor = LiveTex.addEventListener(
    LiveTex.Event.CONVERSATION_STARTED, onConversationStarted);

 // Удаление обработчика
 LiveTex.removeEventListener(
    LiveTex.Event.CONVERSATION_STARTED, descriptor);

Описание  Устанавливает набор отделов,
 которые будут показаны посетителю в выпадающем списке окна приветствия.  В выпадающем окне будут отображены только те отделы,
 в которых есть доступные операторы.
 Если среди установленных отделов нет отделов с доступными операторами,
 то, при открытии окна поситителем, будет отображена оффлайн форма.  Параметры     Имя  Тип  Описание  Опциональность      deptIds  !Array.  string   Идентификаторы отделов  Опциональный    complete  !function()  Обработчик  Опциональный     Пример  LiveTex.setWelcomeDepartments(['123', '124'], function() {
  alert('Группа назначена');
 });

Описание  Открывает диалоговое окно обращения.
Можно рекомендовать определённого оператора или отдел.
При указании '*' вместо departmentId или employeeId выберется любой
оператор/группа.
Если в момент вызова метода на сайте нет ни одного доступного оператора,
откроется offline-окно. При этом в complete вернётся null.   Параметры     Param  Type  Description      complete  function  Обработчик успешного результата.    Принимает объект назначенного оператора.    cancel  function  Обработчик ошибки    employeeId  string  Рекомендуемый оператор.    departmentId  string  Рекомендуемый отдел.    message  string  Первое сообщение обращения      Пример  LiveTex.showConversationWindow(
  function(employee) {
   console.log(employee ?
         'Открыт диалог с оператором ' + employee.name :
         'Открыто оффлайн окно');
  },
  function(error) { console.error(error); },
  '*', '16429',
  'Первое сообщение'
);
